void setXfp4Severity(char *alarm, long severity_value)
{
	DEBUGMSGTL(("verbose:setXfp4Severity:setXfp4Severity","called\n"));

	shm_handler_create(pt_monitor_struct);

	if(strcmp(alarm, "presence") == 0)
	{
		pt_monitor_struct->xfp_struct.severity[3].presence = severity_value;
	}
	else if(strcmp(alarm, "rx_loss") == 0)
	{
		pt_monitor_struct->xfp_struct.severity[3].rx_loss = severity_value;
	}
	else if(strcmp(alarm, "ready") == 0)
	{
		pt_monitor_struct->xfp_struct.severity[3].ready = severity_value;
	}
	else if(strcmp(alarm, "tx_power") == 0)
	{
		pt_monitor_struct->xfp_struct.severity[3].tx_power = severity_value;
	}
	else if(strcmp(alarm, "rx_power") == 0)
	{
		pt_monitor_struct->xfp_struct.severity[3].rx_power = severity_value;
	}
	else if(strcmp(alarm, "temperature") == 0)
	{
		pt_monitor_struct->xfp_struct.severity[3].temperature = severity_value;
	}
	else if(strcmp(alarm, "low_tx_power") == 0)
	{
		pt_monitor_struct->xfp_struct.severity[3].low_tx_power = severity_value;
	}
	else if(strcmp(alarm, "high_tx_power") == 0)
	{
		pt_monitor_struct->xfp_struct.severity[3].high_tx_power = severity_value;
	}
	else if(strcmp(alarm, "low_rx_power") == 0)
	{
		pt_monitor_struct->xfp_struct.severity[3].low_rx_power = severity_value;
	}
	else if(strcmp(alarm, "high_rx_power") == 0)
	{
		pt_monitor_struct->xfp_struct.severity[3].high_rx_power = severity_value;
	}
	else if(strcmp(alarm, "rx_cdr_loss_of_lock") == 0)
	{
		pt_monitor_struct->xfp_struct.severity[3].rx_cdr_loss_of_lock = severity_value;
	}
	else if(strcmp(alarm, "tx_cdr_loss_of_lock") == 0)
	{
		pt_monitor_struct->xfp_struct.severity[3].tx_cdr_loss_of_lock = severity_value;
	}
	else if(strcmp(alarm, "laser_fault") == 0)
	{
		pt_monitor_struct->xfp_struct.severity[3].laser_fault = severity_value;
	}

	// Set dirty flag
	pt_monitor_struct->sev_dirty_flag = 1;
}

